import React, { Component } from "react";
import history from "../routes/history";

class Navbar extends Component {
  changeRoute(route) {
    history.push(route);
  }

  privateNav() {
    return (
      <div class="nav-wrapper blue">
        <a href="#" className="brand-logo">
          Logo
        </a>
        <ul id="nav-mobile" className="right hide-on-down">
          <li>
            <a onClick={() => this.changeRoute("login")}>logout</a>
          </li>
        </ul>
      </div>
    );
  }

  VisitorNav() {
    return (
      <div class="nav-wrapper blue">
        <a href="#" className="brand-logo">
          Logo
        </a>
        <ul id="nav-mobile" className="right hide-on-down">
          <li>
            <a onClick={() => this.changeRoute("register")}>Register</a>
          </li>
          <li>
            <a onClick={() => this.changeRoute("login")}>Login</a>
          </li>
        </ul>
      </div>
    );
  }

  render() {
    return <nav>{authenticated ? this.PrivateNav() : this.VisitorNav()}</nav>;
  }
}

Navbar.propTypes = {};

// function mapDispatchToProps(dispatch) {
//   return {
//     disableAuth: () => dispatch(normal.disableAuth())
//   };
// }

function mapStateToProps(state) {
  return {
    authenticated: state.user.auth
  };
}

export default connect(
  mapStateToProps,
  null
)(Navbar);

// export default Navbar;
